INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.029, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0, 1, 1.5, 110, 160, 101, 105, 122601, 1, 1, 0, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.014, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 1, 2, 2.5, 105, 120, 102, 111, 122401, 2, 0, 0, 3);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.017, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0, 3, 2.5, 110, 350, 103, 105, 122501, 3, 0, 1, 2);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.016, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 1, 4, 1.5, 110, 130, 104, 105, 107501, 4, 0, 0, 3);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.014, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0, 5, 2.5, 110, 160, 105, 105, 107601, 5, 1, 0, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.029, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0, 6, 3.5, 120, 255, 106, 103, 107801, 6, 0, 1, 2);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.013, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0, 7, 3.5, 120, 160, 107, 103, 110601, 7, 1, 0, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.014, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0, 8, 2.5, 110, 350, 108, 103, 110401, 8, 0, 1, 2);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.012, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 1, 9, 1.5, 105, 130, 109, 100, 110501, 9, 0, 0, 3);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.014, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0, 10, 2.5, 105, 200, 110, 103, 115701, 10, 1, 0, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.071, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0, 11, 2.5, 105, 350, 111, 103, 113601, 11, 0, 1, 2);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.014, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 1, 12, 1.5, 120, 130, 112, 103, 107901, 12, 0, 0, 3);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.022, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0, 13, 1.5, 110, 200, 113, 105, 108001, 13, 1, 0, 2);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.031, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0, 14, 2.5, 110, 160, 114, 108, 110301, 14, 1, 0, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.036, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 1, 15, 0.5, 110, 130, 115, 105, 107701, 15, 0, 0, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.048, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0, 16, 3.5, 110, 350, 116, 95, 113101, 16, 0, 1, 2);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.043, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 1, 17, 1.5, 105, 130, 117, 105, 113301, 17, 0, 0, 3);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.018, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 1, 18, 1.5, 105, 130, 118, 95, 113201, 18, 0, 0, 2);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.021, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0, 19, 2.5, 110, 160, 119, 108, 117001, 19, 1, 0, 2);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.036, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0, 20, 2.5, 110, 255, 120, 105, 113501, 20, 0, 1, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.02, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0, 21, 2.5, 105, 350, 121, 105, 113401, 21, 0, 1, 3);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.018, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 1, 22, 2.5, 110, 130, 122, 105, 110101, 22, 0, 0, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.03, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0, 23, 3.5, 105, 160, 123, 111, 110001, 23, 1, 0, 3);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.027, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1, 24, 1.5, 110, 130, 124, 103, 117201, 24, 0, 0, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.02, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0, 25, 3.5, 105, 160, 125, 108, 117301, 25, 1, 0, 2);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.04, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0, 26, 2.5, 110, 350, 126, 105, 117401, 26, 0, 1, 3);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.009, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0, 27, 3.5, 110, 350, 127, 105, 117101, 27, 0, 1, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.022, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0, 28, 3.5, 120, 255, 128, 105, 122901, 28, 0, 1, 1);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.028, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 1, 29, 2.5, 110, 130, 129, 105, 122801, 29, 0, 0, 3);
INSERT INTO `v1_3088d8106bd827cd44964b27e275be5704751fbc28df12a83cc4c53510316f68` VALUES (0.023, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0, 30, 3.5, 105, 130, 130, 108, 122701, 30, 1, 0, 2);
